(34, '2016-05-09', '2016-05-17', '00:00:00', 'oib', 'Eindopdracht OIB', '<p>Vertel in 1-2 A4:<br /> - Waarom je Informatica & Biologie bent gaan studeren, en wat je er nu van vindt;<br /> - Welke vragen je met I&B zou willen beantwoorden. Je kunt hierbij ook denken aan de colleges, wat vind je interessanter? Genomics of genomicstechnologie? Systeembiologie? Medische genetica? Data-analyse in R?<br /> - Ten slotte: waarom is Informatica & Biologie belangrijk? Wat is het verschil met Informatica óf Biologie?<br /> <br /> Je hoeft niet precies alle punten te beantwoorden, maar maak er een goed geschreven stuk van, en stuur het vóór volgende week (17 mei) naar mij op! En zorg dat je het volgende week voor je mede-studenten in vijf minuten mondeling kunt uitleggen.</p>\r\n<p> </p>', '', '', '', '', 1),
