(37, '2016-09-08', '2016-09-28', '23:59:00', 'ds', 'Programmeeropgave 1 (Stapel)', '<p style="left: 564.6px; top: 301.256px; font-size: 19.9253px; font-family: serif; transform: scaleX(0.886092);" data-canvas-width="267.5998656575146">Bouw vier versies van een stapel (ofwel stack) en een simpel testprogramma.</p>\r\n<p style="left: 564.6px; top: 301.256px; font-size: 19.9253px; font-family: serif; transform: scaleX(0.886092);" data-canvas-width="267.5998656575146">Voor deze kleine opdracht is een verslag niet nodig. Stuur je bijdrage (vier implementaties plus main met test) in een zip-file naar data.structuren.2016@gmail.com met in het onderwerp [STAPEL] gevolgd door de achternamen van de inzenders. Stuur een cc naar je partner zodat een antwoord aan iedereen gegeven kan worden.</p>', 'http://liacs.leidenuniv.nl/~hoogeboomhj/dat/progopgaven/ds_2016_opdracht1.pdf', 'https://github.com/Wicloz/DSPO_1_Stapel', '', 'Hanny', 1),
