(78, '2016-10-29', '2016-11-01', '09:00:00', 'hcltvr', 'Prepare a short presentation on educational innovation', '<p>The goals of the lecture on the 1st of November are:</p>\r\n<ul>\r\n<li>Identifying important innovations currently happening in the field of education and how they are related to the use of Virtual Reality in education.</li>\r\n<li>Shaping an overview of the different settings in which learning can take place, inside and outside educational institutions.</li>\r\n</ul>\r\n<p>Interesting things to consider: MOOC''s, Open and Online Education, blended learning, the role of the teacher, life-long learning, digital badges, adaptive learning environments, etc.<br /><br /><strong>Assignment</strong></p>\r\n<ul>\r\n<li>Read some of the reading material in #education_innovation. The 2016 Trendreport from SURF is recommended, but this is not offically released yet. Because of this, I ask you to not share this with anyone. Furthermore, it''s only available in Dutch at this moment.</li>\r\n<li>Pick an interesting development and do some more online research on it.</li>\r\n<li>Prepare a 3-5 minute presentation on the educational innovation and perhaps how it is related to the use of VR in education. Why is it interesting for us?</li>\r\n<li>Create a post in #education_innovation with your speaker notes, or the story you want to tell written out. Please pick a meaningful title.</li>\r\n</ul>\r\n<p>I''ll select ~10 of the posts to be presented next lecture. Please make your presentations short, then we''ll have some extra time for discussion. You can use slides if you want to, but don''t spend too much time on them, as not everyone will present. It''s easiest to send the slides to me in a DM.</p>', 'https://ltvr2016.slack.com/messages/education_innovation/', '', '', '', 1),
