(103, '2016-12-12', '2017-02-07', '19:00:00', 'hcltvr', 'Write essay on VR project', '<p>In your essay you explain your project, the design choices you''ve made and the possible implementation in educational practice. Try to answer questions like:</p>\r\n<ul>\r\n<li>    What is the target group of your application?</li>\r\n<li>    For what educational setting(s) is your application best suited?</li>\r\n<li>    What does your application try to explain?</li>\r\n<li>    How is this content explained now? How does your project improve this?</li>\r\n<li>    What characteristics of VR does your project use?</li>\r\n</ul>\r\n<p>Around 1500-3000 words. Generally I prefer concise essays. A general introduction of VR is not necessary for example.</p>', '', '', '', '', 1),
