(172, '2017-10-04', '2017-10-19', '13:30:00', 'ibs', 'Presentation ''Biomedical devices and systems security''', '<p> </p>\r\n<p> </p>\r\n<p class="MsoPlainText">Zoals eerder besproken dient de presentatie 15 - 20 minuten lang te zijn waarbij een heldere weergave van de probleemstelling(-en), voorgestelde oplossingen en wetenschappelijke onderbouwing van de resultaten moeten worden gepresenteerd. Zorg ervoor dat het publiek het begrijpt en hanteer waar nodig een kritisch wetenschappelijke toon!</p>\r\n<p class="MsoPlainText"> </p>\r\n<p class="MsoPlainText">Tevens dient iedereen minstens de titel, abstract en conclusies van alle papers in de zip-file gelezen en globaal begrepen te hebben.</p>', '', '', 'https://docs.google.com/presentation/d/1RwokMfWkcKgHM9uOnKn2ud0qBUVv8AvbDFOSM2gljsc/view?usp=sharing', '', 1),
