(18, 'Datastructuren', 'ds', 'inf', '<p>Tentamen - Eindcijfer</p>\r\n<p>        + kleine bonus van programmeeropgaven</p>\r\n<p>Pogrammeeropgaven - Moet voldoende zijn</p>', '{"Home + Opgaven":"http://liacs.leidenuniv.nl/~hoogeboomhj/dat/","Materiaal":"http://liacs.leidenuniv.nl/~hoogeboomhj/dat/ohp/","Werkcollege Info":"http://liacs.leidenuniv.nl/~hoogeboomhj/dat/progopgaven/DS%20intro.pdf","Handout":"http://liacs.leidenuniv.nl/~hoogeboomhj/dat/ohp/datastructures-notes.pdf"}', 0),
(19, 'Continue Wiskunde 1', 'cw1', 'inf', '<p>5x huiswerk, 10% bonus voor tentamencijfer</p>\r\n<p>Deadlines: om 11:15</p>\r\n<ul>\r\n<li>Je moet de hele uitwerking opschrijven en niet alleen het antwoord geven.</li>\r\n<li>Je moet het huiswerk op het college inleveren. Handgeschreven (mits goed leesbaar) en getypt mag alletwee.</li>\r\n<li>Zet je naam en studentnummer op het huiswerk.</li>\r\n</ul>', '{"Home":"http://pub.math.leidenuniv.nl/~evertsejh/contwisk.html","Marks":"https://docs.google.com/spreadsheets/d/1eIwxvjFnseCPed5tpzvzCAPDIoCYCjfq-BXB12XFfas/pubhtml?gid=1029469859&single=true"}', 0),
(20, 'Lineaire Algebra 1', 'la1', 'inf', '<p>Maandag</p>\r\n<ul>\r\n<li>College</li>\r\n</ul>\r\n<p>Donderdag</p>\r\n<ul>\r\n<li>Werkcollege</li>\r\n<li>Huiswerk</li>\r\n<li>Toets (25%)</li>\r\n</ul>', '{"Home":"http://pub.math.leidenuniv.nl/~holmesdst/teaching/2016-2017/LA1/index.html","Marks":"https://docs.google.com/spreadsheets/d/1au3hqid4J4Htf0gXV7E913jTuwIOvmdc7IsP-MkcSDU/edit"}', 0),
(21, 'Digitale Technieken', 'dite', 'inf', '<ul>\r\n<li>Homework instructions posted on the website every Thursday check regularly the course website!</li>\r\n<li>Hand in each homework within 7 days after instructions are posted use the box in room 122</li>\r\n</ul>\r\n<h2 class="western"><span style="font-family: Ariel;">Exams:</span></h2>\r\n<ul>\r\n<li>\r\n<p><span style="font-family: Ariel;"><span style="font-size: large;">There will be one midterm and one final exam at the end of the course. You <span style="color: #ff0000;">must</span> be present at these exams.</span></span></p>\r\n</li>\r\n<li>\r\n<p><span style="font-family: Ariel;"><span style="font-size: large;">In case you fail at the final exam, there will be a re-take exam.</span></span></p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<h2 class="western"><span style="font-family: Ariel;">Format of the exams:</span></h2>\r\n<ul>\r\n<li>\r\n<p><span style="font-family: Ariel;"><span style="font-size: large;">Solving problems (pan and paper work only)</span></span></p>\r\n</li>\r\n</ul>\r\n<p> </p>\r\n<h2 class="western"><span style="font-family: Ariel;">Time Table and Location:</span></h2>\r\n<table style="page-break-inside: avoid;" width="814" cellspacing="0" cellpadding="4"><colgroup><col width="154" /> <col width="325" /> <col width="131" /> <col width="150" /> </colgroup>\r\n<tbody>\r\n<tr>\r\n<td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0.04in 0in 0.04in 0.04in;" width="154">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;"><strong>Exams</strong></span></span></p>\r\n</td>\r\n<td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0.04in 0in 0.04in 0.04in;" width="325">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;"><strong>Date</strong></span></span></p>\r\n</td>\r\n<td style="border-top: 1px solid #000000; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0.04in 0in 0.04in 0.04in;" width="131">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;"><strong>Time</strong></span></span></p>\r\n</td>\r\n<td style="border: 1px solid #000000; padding: 0.04in;" width="150">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;"><strong>Place</strong></span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="154">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">Midterm Exam</span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="325">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">October 26, 2016</span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="131">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">14:00-17:00</span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; padding: 0in 0.04in 0.04in 0.04in;" width="150">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">TBA</span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="154">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">Final Exam</span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="325">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">January 16, 2017</span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: none; padding: 0in 0in 0.04in 0.04in;" width="131">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">14:00-17:00</span></span></p>\r\n</td>\r\n<td style="border-top: none; border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; padding: 0in 0.04in 0.04in 0.04in;" width="150">\r\n<p align="CENTER"><span style="font-family: Arial;"><span style="font-size: large;">TBA</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\r\n<h2 class="western"><span style="font-family: Ariel;">Grading:</span></h2>\r\n<p><span style="font-family: Ariel;"><span style="font-size: large;">You will receive three Grades: one for the midterm exam (<span style="color: #ff0000;">Gme</span>), one for the final exam (<span style="color: #ff0000;">Gfe</span>), and one for the design project (<span style="color: #ff0000;">Gp</span>). All of them are important and will form your <span style="color: #ff0000;">Final Grade</span> as follows: </span></span></p>\r\n<p><span style="font-family: Ariel;"><span style="font-size: large;">If (<span style="color: #ff0000;">Gfe ≥ 6 </span>and<span style="color: #ff0000;"> Gp ≥ 6</span>) Then <span style="color: #ff0000;">Final Grade = 0.4*Gfe + 0.4*Gp + 0.2*Gme </span><span style="color: #000000;">Else </span><span style="color: #ff0000;">Final Grade ≤ 5</span></span></span></p>', '{"Home":"http://liacs.leidenuniv.nl/~stefanovtp/courses/DITE/","Lectures":"http://liacs.leidenuniv.nl/~stefanovtp/courses/DITE/lectures.html","Homework":"http://liacs.leidenuniv.nl/~stefanovtp/courses/DITE/homeworks.html","Tutorials":"http://liacs.leidenuniv.nl/~stefanovtp/courses/DITE/tutorials.html"}', 0),
(22, 'Moleculaire Biologie', 'mb', 'bio', '', '{"Announcements":"https://blackboard.leidenuniv.nl/webapps/blackboard/execute/announcement?method=search&context=course_entry&course_id=_160798_1&handle=announcements_entry&mode=view","Lectures":"https://blackboard.leidenuniv.nl/webapps/blackboard/content/listContent.jsp?course_id=_160798_1&content_id=_3738255_1"}', 0),
(23, 'Bio-Ethiek', 'be', 'bio', '', '{"Announcements":"https://blackboard.leidenuniv.nl/webapps/blackboard/execute/announcement?method=search&context=course_entry&course_id=_160786_1&handle=announcements_entry&mode=view","Schedule":"https://blackboard.leidenuniv.nl/bbcswebdav/pid-3700291-dt-content-rid-3925076_1/courses/4022BET15-1617FWN/rooster%20bio-ethiek%20boor%20biologen%20en%20bioinformatici%202016%20inclusief%20zalen.pdf"}', 0),
(24, 'Caleidoscoop', 'cs', 'hc', '<p><span style="font-size: small;"><strong>Caleidoscoop is een lezingenreeks bestaande uit 12 lezingen waarvan je er 10 dient te volgen</strong></span><span style="font-size: small;">.</span></p>\r\n<ol>\r\n<li>Iedere week bestaat uit een lezing en een interactief deel. <strong>Goede voorbereiding is dus noodzakelijk</strong>. Ongeveer 1 week voor de lezing staat de titel van de lezing en het <strong>bijbehorende leeswerk</strong> in het mapje ''course documents''</li>\r\n<li>Op de dag van de lezing moet je<strong> drie vragen</strong> die je voor de spreker hebt n.a.v. het leeswerk, inleveren via het forum ''vragen inleveren''. Dit kan tot 9.00 uur ''s morgens op de dag van de lezing, daarna is het forum gesloten!</li>\r\n<li>Elke week wordt er een <strong>voorzitter</strong> benoemd. De taken van de voorzitter staan bij ''Course documents''. Ook ontvangt de voorzitter voorafgaand aan de lezing een mail met instructies van de student-assistent. De voorzitter maakt een selectie uit de ingezonden vragen. Uiteraard is er ook ruimte voor vragen die je ter plekke tijdens de lezing bedenkt, maar de voorzitter kan ook ruimte maken voor goede vragen die vooraf al via het forum zijn ingeleverd. </li>\r\n<li>Na afloop van de lezing staat de (eventuele) <strong>presentatie</strong> op Blackboard bij ''Course Documents''.</li>\r\n<li>Toetsing vindt plaats door middel van het inleveren van twee <strong>verslagen</strong> en het inleveren van twee <strong>reviews</strong> van verslagen van je medestudenten. Dat wordt t.z.t. via turnitin op Blackboard aangekondigd en georganiseerd.</li>\r\n</ol>\r\n<p> </p>', '{"Prospectus":"https://studiegids.leidenuniv.nl/courses/show/64131/caleidoscoop","Announcements":"https://blackboard.leidenuniv.nl/webapps/blackboard/execute/announcement?method=search&context=course_entry&course_id=_163559_1&handle=announcements_entry&mode=view","Literature":"https://blackboard.leidenuniv.nl/webapps/blackboard/content/listContent.jsp?course_id=_163559_1&content_id=_3672741_1&mode=reset"}', 0),
(25, 'Persoonlijke Effectiviteit', 'pe', 'hc', '<p>Onderwijsvorm:</p>\r\n<p>Invullen persoonlijkheidstest<br /> 1 introductiebijeenkomst à 4 uren<br /> 2 intervisiebijeenkomsten à 2 uren<br /> 2 werkgroepen presentatievaardigheden à 2 uren</p>', '{"Prospectus":"https://studiegids.leidenuniv.nl/courses/show/64035/persoonlijke-effectiviteit"}', 0),
(26, 'Learning Through Virtual Reality', 'hcltvr', 'hc', '<h3>Course Load</h3>\r\n<p>This course is worth 5 EC, which means the total course load equals 140 hours.</p>\r\n<ul>\r\n<li>Lectures and workshops: 11 sessions of 2 hours = 22 hours</li>\r\n<li>Literature reading & practical work: 2 hours per session = 22 hours</li>\r\n<li>Small assignments: 12 hours</li>\r\n<li>Final assignment: 60 hours</li>\r\n<li>Final essay: 24 hours</li>\r\n</ul>\r\n<h3>Assessment method</h3>\r\n<ul>\r\n<li>20% Course contribution and small assignments</li>\r\n<li>60% Final project</li>\r\n<li>20% Final paper</li>\r\n</ul>', '{"Prospectus":"https://studiegids.leidenuniv.nl/courses/show/65815/learning-through-virtual-reality","Slack":"https://ltvr2016.slack.com"}', 0),
