(29, 'On Being a Scientist', 'obas', 'inf', '<p>Weekly individual assignments</p>\r\n<ul>\r\n<li>Tuesday before 09:00</li>\r\n<li>Marking by peer review</li>\r\n<li>Deadline for reviews riday morning 09:00</li>\r\n</ul>\r\n<p>Weekly group assignments</p>\r\n<ul>\r\n<li>Tuesday before 09:00</li>\r\n<li>Finish during class</li>\r\n</ul>', '{"Announcements":"https://blackboard.leidenuniv.nl/webapps/blackboard/execute/announcement?method=search&context=course_entry&course_id=_163806_1&handle=announcements_entry&mode=view","Assignments":"https://blackboard.leidenuniv.nl/webapps/blackboard/content/listContent.jsp?course_id=_163806_1&content_id=_3845774_1&mode=reset"}', 0),
(30, 'Programmeertechnieken', 'pt', 'inf', '<p>Geen tentamen</p>\r\n<p>4 Opgaven</p>\r\n<ul>\r\n<li>= Het eindcijfer</li>\r\n<li>2, 3, 3, 3 personen</li>\r\n</ul>\r\n<p>3 Huiswerkopgaven</p>\r\n<ul>\r\n<li>Moet voldoende zijn</li>\r\n<li>Teld verder niet mee</li>\r\n<li>Maximaal 4 uur per opgave</li>\r\n<li>2, 2, 2 personen</li>\r\n</ul>', '{"Home":"http://liacs.leidenuniv.nl/~rietveldkfd/courses/pt2017/","Schedule":"http://liacs.leidenuniv.nl/~rietveldkfd/courses/pt2017/weekschema.html","News":"http://liacs.leidenuniv.nl/~rietveldkfd/courses/pt2017/nieuws.html","Assingments":"http://liacs.leidenuniv.nl/~rietveldkfd/courses/pt2017/practicum.html","Slides":"http://liacs.leidenuniv.nl/~rietveldkfd/courses/pt2017/literatuur.html"}', 0),
